INSERT INTO `jenis_ikan` (`id`, `nama_ikan`, `harga`, `deskripsi`, `foto`) VALUES
	(1, 'Alu-Alu', 25000, 'Barakuda adalah ikan dalam kelas Actinopterygii yang dikenal berwujud menyeramkan dan berukuran tubuh besar, yaitu sampai panjang enam kaki dan lebar satu kaki. Tubuhnya panjang dan ditutupi oleh sisik yang halus. Ikan ini dapat ditemukan di samudra tropis dan subtropis di seluruh dunia. Barakuda adalah anggota genus Sphyraena, satu-satunya genus dalam familia Sphyraenidae.', 'salmon-raksasa-_130426073921-783.jpg'),
	(2, 'Bandeng', 25000, 'Ikan bandeng (Chanos chanos) adalah ikan pangan populer di Asia Tenggara dan Oseania. Ikan ini merupakan satu-satunya spesies yang masih ada dalam suku Chanidae (bersama enam genus tambahan yang dilaporkan pernah ada namun sudah punah). Dalam bahasa Bugis dan Makassar dikenal sebagai ikan bolu, dalam Bahasa Tagalog sebagai bangus, dan dalam bahasa Inggris sebagai milkfish)', 'bandeng.png'),
	(3, 'Bawal', 20000, 'Bawal Laut (bahasa Inggris: Pomfret) adalah sejenis ikan dari keluarga Bramidae. Ikan ini berasal dari Hawaii dan sejumlah daerah di Indonesia. Ikan ini hidup berkoloni dan termasuk jenis ikan predator. Ikan ini jauh berbeda dengan ikan Bawal Air Tawar atau Pacu (Colossoma macropomum) yang termasuk kedalam famili Serrasalmidae.', 'Oreo_nilo_071011-0507_F_jtg.jpg'),
	(21, 'Beloso', 59000, 'adalah nama sejenis ikan air tawar. Meskipun ada yang berukuran besar, ikan yang menyebar di Asia Tenggara hingga Kepulauan Nusantara ini digemari pemancing karena betotan (tarikan)nya yang kuat dan tiba-tiba', 'beloso.jpg'),
	(22, 'Cakalang', 28000, 'Ikan Cakalang (Katsuwonus pelamis) adalah ikan berukuran sedang dari familia Scombridae (tuna). Satu-satunya spesies dari genus Katsuwonus. Cakalang terbesar, panjang tubuhnya bisa mencapai 1 m dengan berat lebih dari 18 kg. Cakalang yang banyak tertangkap berukuran panjang sekitar 50 cm. Nama-nama lainnya di antaranya cakalan, cakang, kausa, kambojo, karamojo, turingan, dan ada pula yang menyebutnya tongkol. Dalam bahasa Inggris dikenal sebagai skipjack tuna.', 'cakalang.jpg'),
	(23, 'Cumi-Cumi', 61500, 'Cumi-cumi adalah kelompok hewan sefalopoda besar atau jenis moluska yang hidup di laut. Nama "Sefalopoda" dalam bahasa Yunani berarti "kaki kepala", hal ini karena kakinya yang terpisah menjadi sejumlah tangan yang melingkari kepala. Seperti semua sefalopoda, cumi-cumi dipisahkan dengan memiliki kepala yang berbeda. Akson besar cumi-cumi ini memiliki diameter 1 mm. Cumi-cumi banyak digunakan sebagai makanan.', 'cumicumi.jpg'),
	(24, 'Ekor Kuning', 25000, 'Ikan Ekor Kuning (Caesionidae) adalah Ikan laut yang hidup di perairan Indo-Pasifik. Ikan ini disebut fusilier, suli, sulih, suliri, sunin. Warna umumnya biru, kuning pada bagian belakangnya dan perak. Jenis ini dikenal sebagai perenang cepat dan termasuk ikan diurnal. Ikan ini sering ditemukan di luar karang (tubir karang). Makanannya adalah zooplankton.', 'ekorkuning.jpg'),
	(25, 'Gabus', 16500, 'Ikan Gabus adalah sejenis ikan predator yang hidup di air tawar. Ikan ini dikenal dengan banyak nama di berbagai daerah: dolak Kapuas Hulu, Kalbar, bocek dari riau, aruan, haruan (Mly.,Bjn), gabus (Btw.), bogo (Sd.), bayong, bogo, licingan (Bms.), kutuk (Jw.), kabos (Mhs.),gabos (Plbg.), rutiang (min), haruti atau la\'edo Nias, dan lain-lain. Dalam bahasa Inggris juga disebut dengan berbagai nama seperti common snakehead, snakehead murrel, chevron snakehead, striped snakehead dan juga aruan. Nama ilmiahnya adalah Channa striata (Bloch, 1793).', 'gabus.jpg'),
	(26, 'Gindara', 14000, 'Gindara, Lepidocybium flavobrunneum, adalah sebuah spesies ikan dalam famili Gempylidae, yang dapat ditemukan di kedalaman (200–885 meter (656–2.904 ft)) perairan tropis dan subtropis di seluruh dunia. Ikan ini juga dikenal sebagai makarel ular, walu walu (Hawaii: waloo).', 'gindara.jpg'),
	(27, 'Golok-Golok', 10000, 'Ikan mola-mola (disebut pula ikan matahari) adalah semua ikan yang termasuk dalam genus Mola (keluarga Molidae). Ikan ini memiliki bentuk yang tampak buntung dan berbentuk seperti peluru karena sirip belakangnya yang tidak pernah berkembang. Seiring bertambahnya usia ikan, sirip tersebut justru melipat dan membentuk bagian bulat bernama clavus. Mola dalam bahasa Latin berarti "batu kilangan", yang mendeskripsikan bentuk ikan ini. Ikan dalam genus ini berwarna perak dan memiliki tekstur kulit yang kasar.', 'golok.jpg'),
	(28, 'Gulamah', 10000, 'Gulama (bahasa Kannada: ಗುಲಾಮ) adalah sebuah film drama India-Karnataka dirilis pada tahun 2009. Film yang disutradarai oleh Tushar Ranganath ini pemainnya antara lain adalah Prajwal Devraj, Sonu, dan Biyanka Desai', 'gulamah.jpg'),
	(29, 'Gurami', 45000, 'Ikan Gurami (Osphronemus gouramy) adalah sejenis ikan air tawar yang populer sebagai ikan konsumsi di Asia Tenggara dan Asia Selatan. Di samping itu, gurami juga sering dipelihara dalam akuarium. Selain dikenal dengan nama gurami, ikan ini juga memiliki beberapa sebutan lokal seperti gurame (Sd.); grameh (Jw.); kaloi (My.); Kalui (Mng.); ikan kali (Plg.), dan lain-lain.', 'gurami.jpg'),
	(30, 'Hiu', 14500, 'Ikan Hiu atau Cucut adalah sekelompok (superordo Selachimorpha) ikan dengan kerangka tulang rawan yang lengkap  dan tubuh yang ramping. Mereka bernapas dengan menggunakan lima liang insang (kadang-kadang enam atau tujuh, tergantung pada spesiesnya) di samping, atau dimulai sedikit di belakang, kepalanya. Hiu mempunyai tubuh yang dilapisi kulit dermal denticles untuk melindungi kulit mereka dari kerusakan, dari parasit, dan untuk menambah dinamika air. Mereka mempunyai beberapa deret gigi yang dapat digantikan.', 'hiu.jpg'),
	(31, 'Kakap', 35000, 'Kakap adalah keluarga ikan laut dasaran (demersal) yang hidup secara berkelompok di dasar-dasar karang atau terumbu karang. Kakap termasuk famili Lutjanidae. Mempunyai ciri tubuh yang bulat pipih dengan sirip memanjang sepanjang punggung. Jenis ikan kakap yang banyak ditemui di Indonesia adalah jenis kakap merah (L. campechanus). Beberapa jenis yang lain yang juga banyak ditemui adalah kakap kuning, kakap hitam dan lain-lain.', 'kakap.jpg'),
	(32, 'Kembung', 19000, 'Kembung adalah nama sekelompok ikan laut yang tergolong ke dalam genus Rastrelliger, famili Scombridae. Meskipun bertubuh kecil, ikan ini masih sekerabat dengan tenggiri, tongkol, tuna, madidihang, dan makerel. Di Sumatra Barat dikenal sebagai ikan Gembolo/gambolo. Di Ambon, ikan ini dikenal dengan nama lema atau tatare, di Makassar disebut banyar atau banyara. Dari sini didapat sebutan kembung banjar.', 'kembung.jpg'),
	(33, 'Kerapu', 61000, 'Dalam bahasa Inggris, "kerapu" disebut grouper atau groper, yang dipercaya berasal dari nama garoupa, yang diperkirakan dari bahasa Portugis. Ada yang mengatakan bahwa nama Portugis ini berasal dari salah satu bahasa asli Amerika Selatan.', 'kerapu.jpg'),
	(34, 'Kurisi', 30000, 'Kerisi (Pristipomoides filamentosus) adalah ikan dasaran yang menghuni dasar perairan tropis Indo-Pasifik. Ikan ini masih satu suku dengan kakap dan merupakan ikan pancing yang umum ditangkap.\r\n\r\n', 'kurisi.jpg'),
	(35, 'Kuro', 11000, 'Kuro (atau kurau) adalah nama umum bagi sekelompok ikan laut yang tergolong ke dalam famili Polynemidae. Menyebar di perairan tropis hingga ugahari, umumnya ikan-ikan ini berwarna keperakan dan biasa hidup bergerombol. Jenis-jenis kuro bisa ditemukan pada saat air pasang tetapi tidak terlalu tinggi, dan biasanya pada kondisi air yang lumayan jernih.', 'kuro.jpg'),
	(36, 'Kuwe', 37000, 'Kuwe gerong atau belitong (Charanx ignobilis) adalah ikan tangkapan umum di kawasan tropis Indo-Pasifik. Dalam bahasa Inggris dikenal sebagai giant trevally atau GT (dibaca jiti). Ikan ini mudah sekali dikenali dari dahinya yang tampak besar dengan warna tubuh keperakan semburat kuning.\r\n\r\n', 'kuwe.jpg'),
	(37, 'Layang', 14500, 'Layang adalah nama sejenis ikan yang termasuk genus Decapterus, famili Carangidae. Ikan-ikan berukuran kecil hingga sedang ini merupakan ikan konsumsi yang cukup penting, dipasarkan dalam keadaan segar atau diolah sebagai ikan pindang, ikan asin, dan lain-lain.', 'layang.jpg'),
	(38, 'Layur', 21000, 'Layur (Trichiurus lepturus) adalah ikan perairan laut yang mudah dikenal dari bentuknya yang panjang dan ramping. Ikan ini tersebar di perairan tropika maupun sedang. Jenis yang ditemukan di Samudera Pasifik dan Samudera Atlantik diketahui merupakan populasi yang berbeda.', 'layur.jpg'),
	(39, 'Lele', 22000, 'Lele atau ikan keli, adalah suatu keluarga ikan yang hidup di air tawar. Lele mudah dikenali karena tubuhnya yang licin, agak pipih memanjang, serta memiliki "kumis" yang panjang, yang mencuat dari sekitar bagian mulutnya. Ikan ini banyak dikonsumsi karena rasanya yang enak jika di masak dan biasanya di goreng atau dibakar.', 'lele.jpg'),
	(40, 'Lemuru', 10000, 'Lemuru (Sardinella lemuru) adalah spesies ikan Actinopterygii dalam genus Sardinella. Di perairan Indonesia ikan ini banyak terdapat di perairan Selat Bali, ikan ini banyak sebutannya seperti, jika badannya masih kecil disebut semenit atau sempenit, Jika beranjak dewasa dan panjang badannya sekitar 12 cm dijuluki protolan. Ketika badannya mencapai 15 cm disebut lemuru. Tapi kalau ukurannya lebih besar lagi disebut lemuru kucing. Tapi ada juga di daerah lain di Bali seperti di Perairan Jimbaran, ikan lemuru ini disebut ikan kucing tanpa mempedulikan ukurannya', 'lemuru.jpg'),
	(41, 'Lencam', 20000, 'Ikan Lencam ( Lethrinidae ) adalah Ikan laut yang termasuk dalam famili Lethrinidae yang dikenal dengan sebutan ikan emperor. Ikan ini merupakan kelompok ikan target nelayan yang dimanfaatkan sebagai ikan konsumsi.', 'lencam.jpg'),
	(42, 'Manyung', 16000, 'Ikan manyung adalah ikan laut yang biasa ditangkap dan diolah sebagai ikan asin khas dari Pangandaran yang disebut jambal roti. Ikan ini adalah anggota bangsa ikan berkumis (Siluriformes), famili Ariidae.', 'manyung.jpg'),
	(43, 'Marlin', 25000, 'ayaran adalah dua jenis ikan di dalam genus Istiophorus yang tinggal di perairan hangat samudra-samudra dunia. Kebanyakan berwarna biru keabu-abuan dan memiliki sirip punggung tegak yang mirip dengan layar kapal. Ciri penting lainnya adalah moncong yang memanjang, menyerupai moncong ikan todak. Ikan ini adalah ikan tercepat, bisa berenang hingga kecepatan 110 kilometer per jam', 'marlin.jpg'),
	(44, 'Nila', 26000, 'Ikan nila adalah sejenis ikan konsumsi air tawar. Ikan ini diintroduksi dari Afrika, tepatnya Afrika bagian timur, pada tahun 1969, dan kini menjadi ikan peliharaan yang populer di kolam-kolam air tawar di Indonesia sekaligus hama di setiap sungai dan danau Indonesia. Nama ilmiahnya adalah Oreochromis niloticus, dan dalam bahasa Inggris dikenal sebagai Nile Tilapia.', 'nila.jpg'),
	(45, 'Pari', 10000, 'Ikan pari atau ikan peh adalah jenis ikan laut yang memiliki 560 spesies dan tergolong dalam 13 famili.', 'pari.jpg'),
	(46, 'Pedang', 23000, 'Todak (Xiphias gladius) adalah sejenis ikan laut yang rahang atas dan moncongnya memanjang berbentuk seperti pedang pipih dan kuat, berukuran hampir sepertiga panjang badan ikan tersebut. Tubuh ikan todak panjang membulat dapat mencapai 2 - 4,6 m dan dapat berbobot hingga 650 kg. Kulitnya licin tidak bersisik, bagian atas tubuhnya berwarna keunguan atau kebiruan dan bagian bawah tubuhnya keperakan. Banyak terdapat di perairan tropis dan perairan iklim sedang', 'pedang.jpg'),
	(47, 'Peperek', 10000, 'Peperek,pepetek, atau petek adalah nama umum bagi jenis-jenis ikan yang tergolong dalam suku Leiognathidae. Ikan-ikan ini umumnya bertubuh kecil, pipih tegak, dan berwarna keperak-perakan, serta memiliki mulut yang dapat dijulurkan. Peperek menghuni lautan dan perairan payau di region Indo-Pasifik Barat. Dalam bahasa Inggris, peperek dikenal sebagai ponyfishes, slipmouths atau slimys/slimies.\r\n\r\n', 'peperek.jpg'),
	(48, 'Selar', 13000, 'Selar adalah nama umum bagi beberapa jenis ikan pelagis bertubuh kecil hingga sedang dari famili Carangidae.', 'selar.jpg');
